sections.code:
body,
#content,
#mw-head,
#mw-page-base {
    background: #F8F5F4 !important;
}

#toc,
.infobox,
.thumbinner,
#mw-content-text > div > table {
    background: #EBE3E1 !important;
}

.mw-body-content {
    font-family: Baskerville, serif;
    font-size: 1.35em;
    line-height: 1.3;
}

.mw-body-content p {
    margin: 0.75em 0;
}

h1,
h2,
h3,
h4,
h5,
h6 {
    border-bottom: none;
    font-family: Baskerville, serif !important;
}

#content {
    border: none;
    margin: auto 20%;
}

#mw-panel {
    display: none;
}

#p-personal,
#left-navigation,
#p-views {
    display: none;
}

#p-navigation,
#p-interaction,
#p-tb,
#p-wikibase-otherprojects,
#p-coll-print_export {
    display: none;
}

body {
    font-size: 1.16em;
    font-family: Baskerville, serif;
    background: #F8F5F4;
    color: #232323;
}

h1,
h2,
h3,
h4,
h5 {
    font-family: Baskerville, serif;
    font-weight: bold;
}

dl dt,
dl dd {
    font-size: 1.15em;
}

p {
    line-height: 1.4em;
}

#page {
    max-width: 61.8%;
    margin: auto;
}

pre {
    background: #EBE3E1;
    font-size: 0.85em
}

p,
li {
    max-width: 100%
}
